import React from 'react'; 
import 'primeflex/primeflex.css'; 
import 'primeicons/primeicons.css';

import { PrimeReactProvider, PrimeReactContext } from 'primereact/api';
        
import "primereact/resources/themes/lara-light-cyan/theme.css";
// import 'primeflex/primeflex.css';  
import 'primereact/resources/primereact.css';
import { Menu } from 'primereact/menu';
import { Avatar } from 'primereact/avatar';
import { Toast } from "primereact/toast";

export default function TemplateDemo() {
    const itemRenderer = (item) => (
        <div className='p-menuitem-content'>
            <a className="flex align-items-center p-menuitem-link">
                <span className={item.icon} />
                <span className="mx-2">{item.label}</span>
                {item.badge && <badge className="ml-auto" value={item.badge} />}
                {item.shortcut && <span className="ml-auto border-1 surface-border border-round surface-100 text-xs p-1">{item.shortcut}</span>}
            </a>
        </div>
    );
    let items = [
        {
            template: () => {
                return (
                    <span className="inline-flex align-items-center gap-1 px-2 py-2">
                        <span className="font-medium text-xl font-semibold">
                            PROJECT<span className="text-primary">Bridge</span>
                        </span>
                    </span>
                );
            }
        },
        {
            separator: true
        },
        {
            label: 'Documents',
            items: [
                {
                    label: 'New',
                    icon: 'pi pi-plus',
                    shortcut: '⌘+N',
                    template: itemRenderer
                },
                {
                    label: 'Search',
                    icon: 'pi pi-search',
                    shortcut: '⌘+S',
                    template: itemRenderer
                }
            ]
        },
        {
            label: 'Profile',
            items: [
                {
                    label: 'Settings',
                    icon: 'pi pi-cog',
                    shortcut: '⌘+O',
                    template: itemRenderer
                },
                {
                    label: 'Messages',
                    icon: 'pi pi-inbox',
                    badge: 2,
                    template: itemRenderer
                },
                {
                    label: 'Logout',
                    icon: 'pi pi-sign-out',
                    shortcut: '⌘+Q',
                    template: itemRenderer
                }
            ]
        },
        {
            separator: true
        },
        {
            command: () => {
                Toast.current.show({ severity: 'info', summary: 'Info', detail: 'Item Selected', life: 3000 });
            },
            template: (item, options) => {
                return (
                    <button onClick={(e) => options.onClick(e)} className='w-full p-link flex align-items-center p-2 pl-4 text-color hover:surface-200 border-noround'>
                        <Avatar image="https://primefaces.org/cdn/primereact/images/avatar/amyelsner.png" className="mr-2" shape="circle" />
                        <div className="flex flex-column align">
                            <span className="font-bold">Amy Elsner</span>
                            <span className="text-sm">Agent</span>
                        </div>
                    </button>
                );
            }
        }
    ];

    return (
        <PrimeReactProvider>
            <div className="card flex justify-content-center">
            <Menu model={items} className="w-full md:w-15rem" />
        </div>
        </PrimeReactProvider>
        
    )
}
